const grouped = {};

// Helper function to parse "DD-MM-YYYY HH:mm:ss" into JS Date
function parseDate(dateStr) {
  if (!dateStr) return null; // safeguard
  const [day, month, rest] = dateStr.split("-");
  if (!rest) return null;
  const [year, time] = rest.split(" ");
  return new Date(`${year}-${month}-${day}T${time}`);
}

// Group orders by customer_email
for (const row of items) {
  const email = row.json.customer_email;
  if (!grouped[email]) {
    grouped[email] = {
      customer_email: email,
      // Optional: include customer name
      name: row.json.billing_first_name + " " + row.json.billing_last_name,
      orders: []
    };
  }
  grouped[email].orders.push(parseDate(row.json.order_date));
}

// Sort orders for each customer
return Object.values(grouped).map(cust => {
  cust.orders = cust.orders.filter(o => o !== null).sort((a, b) => a - b);
  return { json: cust };
});

// Bayesian next-order prediction with Gamma-Poisson (Lomax predictive)
// Works well even with irregular/very few orders.

const DAY = 86400000;

// 1) Clean + sort dates for each customer
const customers = items.map(it => {
  const ds = (it.json.orders || [])
    .map(d => new Date(d))
    .filter(d => !isNaN(d))
    .sort((a, b) => a - b);
  return { ...it.json, _dates: ds };
}).filter(c => c._dates.length >= 1);

// 2) Build a cohort prior from ALL customers in this batch
let Ntot = 0;     // total events across customers
let Wtot = 0;     // total exposure days across customers

for (const c of customers) {
  const N = c._dates.length;
  const W = Math.max(1, Math.round((c._dates[c._dates.length - 1] - c._dates[0]) / DAY));
  Ntot += N;
  Wtot += W;
}

// Cohort baseline rate (events/day). If empty, default ~1 order / 45 days
let lambda0 = (Ntot > 0 && Wtot > 0) ? (Ntot / Wtot) : (1 / 45);

// Prior strength = how strongly we "shrink" sparse customers toward cohort.
// k is "equivalent prior exposure days". Tune 60â€“120 as you like.
const k = 90;
const alpha0 = lambda0 * k;
const beta0  = k;

// Lomax quantile function for predictive time-to-next-order
function qLomax(alpha, beta, q) {
  return beta * (Math.pow(1 / (1 - q), 1 / alpha) - 1); // days
}
// Probability of reordering within D days
function probWithin(alpha, beta, D) {
  return 1 - Math.pow(beta / (beta + D), alpha);
}

// Round to YYYY-MM-DD (UTC)
function yyyyMMdd(d) {
  return new Date(Date.UTC(d.getUTCFullYear(), d.getUTCMonth(), d.getUTCDate()))
    .toISOString()
    .slice(0, 10);
}

const out = customers.map(c => {
  const N = c._dates.length;
  const W = Math.max(1, Math.round((c._dates[c._dates.length - 1] - c._dates[0]) / DAY));
  const last = c._dates[c._dates.length - 1];

  // Posterior over lambda
  const alpha = alpha0 + N;
  const beta  = beta0 + W;

  // Predictive median and interquartile window
  const t50  = qLomax(alpha, beta, 0.5);
  const t25  = qLomax(alpha, beta, 0.25);
  const t75  = qLomax(alpha, beta, 0.75);

  const predDate      = new Date(last.getTime() + t50 * DAY);
  const windowStart   = new Date(last.getTime() + t25 * DAY);
  const windowEnd     = new Date(last.getTime() + t75 * DAY);

  // Useful probabilities for campaigns
  const p30  = probWithin(alpha, beta, 30);   // chance of reordering within 30 days
  const p60  = probWithin(alpha, beta, 60);

  return {
    json: {
      customer_email: c.customer_email,
      name: c.name || null,
      nOrders: N,
      exposureDays: W,
      lastOrder: yyyyMMdd(last),
      cohortRatePerDay: +lambda0.toFixed(6),
      predictedNextOrder: yyyyMMdd(predDate),
      predictionWindowStart: yyyyMMdd(windowStart),
      predictionWindowEnd: yyyyMMdd(windowEnd),
      medianDaysAhead: Math.round(t50),
      probWithin30d: +p30.toFixed(3),
      probWithin60d: +p60.toFixed(3)
    }
  };
});

return out;

// Input: already grouped customers with orders array
const customers = items.map(item => item.json);

// Separate into repeat vs one-time
const repeatCustomers = customers.filter(c => c.orders.length > 1);
const oneTimeCustomers = customers.filter(c => c.orders.length === 1);

// Return both lists
return [
  { json: { type: "repeat_customers", data: repeatCustomers } },
  { json: { type: "one_time_customers", data: oneTimeCustomers } }
];
